import { StyleSheet} from 'react-native';
const userComponentStyles = StyleSheet.create({
  div:{
    backgroundColor: '#000',
    padding:10,
    margin:10,
    borderRadius:5,
    paddingRight:20,
  },
  text:{
    //color:'#1e2833',
    color:'#fff',
    paddingLeft:10,
    textAlign:"center",
  },
  nevek:{
   // color:'#1e2833',
   color:'#fff',
    fontWeight: "bold",
    textAlign:"center",
    paddingBottom:2
  },
  icons:{
    fontSize:15,
    //color:'#1e2833',
    color:'#fff',
    textAlign:"center",
  }
});
export {userComponentStyles};
